// @flow
import React from 'react';
import {
    Row,
    Col,
    Card,
    CardBody,
    CustomInput,
    Form,
    FormGroup,
    Label,
    Input,
    FormText,
    InputGroup,
    InputGroupAddon,
    UncontrolledButtonDropdown,
    Button,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
} from 'reactstrap';


const BasicInputElements = () => {
    return (
        <Card>

                <Row>
                    <Col lg={6}>
                        <Form>
                            <FormGroup>
                                <Input type="text" name="text" id="text" placeholder="with a placeholder" />
                            </FormGroup>
                        </Form>
                    </Col>

                </Row>
        </Card>
    );
};

const BasicForms = () => {
    return (
        <React.Fragment>
            <Row>
                <Col>
                    <BasicInputElements />
                </Col>
            </Row>
        </React.Fragment>
    );
};
export default BasicForms;
